    [],nt"revision_timestamp": "2016-07-28T07:57:03.788674",nt"name": "population-census-bureau-total-estimates-2010-2012",nt"isopen":
    false,nt"url": null,nt"notes": "Total population estimates are estimates
    of the total number of residents living in an area on July 1 of each year. The Census
    Bureauu0092s Population Division produces these July 1 estimates for years after
    the last published decennial census (2010). Estimates created after a decennial
    census, but before the next census, are called postcensal estimates. In addition,
    the Census Bureau revises postcensal estimates once the next decennial census is
    taken. These revised estimates between the decennial census years are called intercensal
    estimates. For the postcensal estimates, existing data series such as births, deaths,
    Federal tax returns, Medicare enrollment, and immigration, are used to update the
    decennial census base counts. The Census Bureauu0092s estimates are used in Federal
    funding allocations, in setting the levels of national surveys, and in monitoring
    recent demographic changes. There are two data tables in this file. Table CIA0001
    shows estimates of total population from april 1, 2010 (Census) to July 1, 2012.
    Table CI0001GR shows annual percentage change in total population, from one period
    to the next, from April 1, 2010 to 2012. These files, along with file-specific descriptions
    (in Word and text formats) are available in a single zip file.",nt"license_title":
